import React from "react";

const HomePage = () => {
  return (
    <div>
      <section id="welcome">
        <h2>Bem-vindo à Landing Page</h2>
        {/* Conteúdo relacionado à seção de boas-vindas */}
      </section>
      <section id="about">
        <h2>Sobre</h2>
        {/* Conteúdo relacionado à seção "Sobre" */}
      </section>
      <section id="instructions">
        <h2>Instruções</h2>
        {/* Conteúdo relacionado à seção de instruções */}
      </section>
      <section id="media">
        <h2>Mídia</h2>
        {/* Conteúdo relacionado à seção de mídia */}
      </section>
    </div>
  );
};

export default HomePage;
